import React from "react";
import trains from "./trains";
function Train()
{
    return(
        <div>
            <h1>Number:{trains[0].no}</h1>
            <h2>Train Name:{trains[0].trainName}</h2>
            <h3>Rate:{trains[0].Rate}</h3>
        </div>

    );
}

export default Train;
